  \"The Importance of Lower Mississippi River Alluvial Valley Reforestation and Wetland
  Restoration Sites to Wintering Migratory Birds; Annual Report\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 11,\n\t\t\"recent\": 3\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T23:03:53.191168\",\n\t\"name\": \"the-importance-of-lower-mississippi-river-alluvial-valley-reforestation-and-wetland-restor\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Major efforts have been initiated in the
  Lower Mississippi River Alluvial Valley (LMA V. Fig. I) from within both the U.S.
  Departments of Interior and Agriculture to restore/enhance wetlands, improve natural
  hydrology and reestablish bottomland hardwood forests. These programs were instigated
  because most palustrine-forested wetlands have been either lost or altered and the
  rate of forested wetland loss continues to increase in the region (Hefner et al.
  1994). These restoration initiatives have many goals, one of which is the management
  of habitats for the benefit of migratory birds. While some management techniques
  are currently available for land managers to pursue these objectives, to date, few
  evaluations of the success of these programs have been made with respect to migratory
  birds. Also, evaluations of the use of these lands by migratory birds have not been
  made, nor have the management methods employed there been evaluated from the standpoint
  of bird use. One group of migratory birds that frequents the LMA V. birds preferring
  early successional habitats (also referred to as grassland and scrub-successional
  birds). is of special interest to wildlife managers for two primary reasons. First,
  as a whole, this group of birds has experienced widespread population declines and
  range reductions (Sauer et a!. 1999). Second, the habitats preferred by these birds
  require perturbations at regular intervals to set succession back to an earlier
  stage (Krementz and Christie 1999). Thus, knowledge of management tools for public-owned
  lands, as well as private lands managed by federal assistance is required. Furthermore,
  understanding the wintering requirements of early-successional species has been
  emphasized by the Southeastern Working Group of Partners in Flight in their Bird
  Conservation Plan for the Mississippi Alluvial Valley (Twedt et al. 1999). Among
  the many general land management tools and programs available to land managers,
  we are in the process of investigating two in particular: reforestation and hydrologic
  restoration. The FWS describe these practices and the evaluation of these programs
  as of national significance in the FWS Research Needs. We hypothesize that both
  management practices will produce habitats that early-successional birds prefer
  compared to sites not managed, and that active management will be necessary to maintain
  the attractiveness of these sites to early-successional birds.\",\n\t\"license_title\":
